import React from 'react';
import '.src/index.css';

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-blue-400 to-purple-600 p-4">
      <header className="header">
        <h1 className="header-title">Bienvenido a EducStation</h1>
        <p className="header-subtitle">
          Descubre un espacio dedicado al aprendizaje, con artículos sobre educación, estrategias de estudio y herramientas innovadoras para potenciar tu conocimiento.
        </p>
      </header>
      <div className="mt-8 text-center">
        <h2 className="text-2xl font-bold text-white mb-4">📚 𝐒𝐞𝐜𝐜𝐢𝐨́𝐧𝐞𝐬 𝐝𝐞𝐥 𝐄𝐝𝐮𝐜𝐒𝐭𝐚𝐭𝐢𝐨𝐧 𝐖𝐞𝐛 𝐁𝐥𝐨𝐠</h2>
        <ul className="text-lg text-white">
          <li>📢 Noticias</li>
          <li>📖 Técnicas de Estudio</li>
          <li>❓ Problemáticas en el Estudio</li>
          <li>🎓 Educación de Calidad</li>
          <li>🛠 Herramientas Tecnológicas</li>
          <li>🚀 Desarrollo Profesional Docente</li>
          <li>🤝 Comunidad y Colaboración</li>
        </ul>
      </div>
      <button className="mt-6 px-6 py-2 bg-white text-blue-600 rounded-lg shadow-md hover:bg-gray-200 transition">
        Leer artículos
      </button>
    </div>
  );
};

export default Home;
